import React, {useState, useEffect} from 'react';
import CSGO from './Images/CSGO.png';
import './Games.css';
import axios from 'axios';


function Games(props) {
    const [data, setData] = useState([]);
    var stringOne, stringTwo, stringThree;
    var GameOne, GameTwo, GameThree

    const fetchAPI = async() => {
      let Games = [];
      const response = await axios.get("http://127.0.0.1:8080/api/members");
      setData(response.data.games);
      console.log(typeof Games);
      for (let key in response.data.games){
        Games.push(response.data.games[key]);
      }

      stringOne = Games[0].replace('[', '');
      stringOne = stringOne.replace(']', '');
      stringOne = stringOne.replace(',', '');
      GameOne = stringOne.split(/\s(?=")/);
      let nameOne = GameOne[0];
      let ratingOne = GameOne[1];
      let priceOne = GameOne[2];

      stringTwo = Games[1].replace('[', '');
      stringTwo = stringTwo.replace(']', '');
      stringTwo = stringTwo.replace(',', '');
      GameTwo = stringTwo.split(/\s(?=")/);
      let nameTwo = GameTwo[0];
      let ratingTwo = GameTwo[1];
      let priceTwo = GameTwo[2];

      stringThree = Games[2].replace('[', '');
      stringThree = stringThree.replace(']', '');
      stringThree = stringThree.replace(',', '');
      GameThree = stringThree.split(/\s(?=")/);
      let nameThree = GameThree[0];
      let ratingThree = GameThree[1];
      let priceThree = GameThree[2];
    };


    //Somewhere around here we need to parse through the strings,
    //remove quotes whenever we find them (as well as []'s), but also
    //use quotes as identifiers for the beginning and end of a string to use.
    

  
    useEffect(() => {
      fetchAPI()
    }, []);

  return (
    <div className = "games">
        <div className = "row-games">
            <div className = "Games-Middle">
                <img
                    src = {CSGO}
                    alt = ""
                />
            </div>
            <br />
            <div className = "Games-Middle">
                <span></span>
            </div>
            <br />
            <div className = "Games-Middle">
                <div className = "Games-Button">
                    <button  onClick = "addGame">
                        
                    </button>
                </div>
            </div>
        </div>
        <div className = "row-games">
            <div className = "Games-Middle">
                <img
                    src = {CSGO}
                    alt = ""
                />
            </div>
            <br />
            <div className = "Games-Middle">
                <span></span>
            </div>
            <br />
            <div className = "Games-Middle">
                <div className = "Games-Button">
                    <button  onClick = "addGame">
                        
                    </button>
                </div>
            </div>
        </div>
        <div className = "row-games">
            <div className = "Games-Middle">
                <img
                    src = {CSGO}
                    alt = ""
                />
            </div>
            <br />
            <div className = "Games-Middle">
                <p></p>
                <span></span>
            </div>
            <br />
            <div className = "Games-Middle">
                <div className = "Games-Button">
                    <button  onClick = "addGame">

                    </button>
                </div>
            </div>
        </div>
    </div>
  );
}

export default Games;
